import React from 'react'

import 'styles.css';  
import {img} from '../assets/topnet.png'; 

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <img src={img} alt="TOPNET" />
      </div>
      <nav className="nav">
        <a href="#moncompte">Moncompte</a>
        <a href="#webmail">Webmail</a>
      </nav>
    </header>
  );
}

export default Header;
